import React from 'react';
import './Navbar.css';

const Navbar = ({ userName, logo }) => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={logo} alt="Logo" />
      </div>
      <div className="navbar-user">
        <span>{userName}</span>
      </div>
    </nav>
  );
};

export default Navbar;
